@GameOfThrones Day 26 of #30DayMapChallenge - Islands

Takabonerate National Park is a marine park which includes the Takabonerate atoll islands, located in the Flores Sea, south of Sulawesi island of Indonesia.
It has been included in the UNESCO World Network of Biosphere Reserves. https://t.co/2G3G9Vrga8
